import { Component } from "react";
import api from "./OpenAI";

class OpenAINLP extends Component {
    constructor() {
        this.api = api;
    }

    getPetNames(specie) {
        return this.api
        .post("nlp-pet-name",{
          specie: specie
        })
        .then((response) => response.data)
        .catch((err) => {
            console.error("ops! ocorreu um erro" + err);
        });
    }

    getHealthCheck() {
      return this.api
        .get("health-check")
        .then((response) => response.data)
        .catch((err) => {
          console.error("ops! ocorreu um erro" + err);
        });
    }
}

export default OpenAINLP;
